import React, { useState } from "react";

function List(props) {
  function click_item(event) {
    clicked(true);
  }
  const [click, clicked] = useState(false);

  return (
    <div>
      <ul>
        <li
          onClick={click_item}
          style={{ textDecoration: click ? "line-through" : null }}
        >
          {props.item}
        </li>
      </ul>
    </div>
  );
}
export default List;
